  getAllSubregionIdentifiers( superRegion ) {
    //Just get the keys for the larger region's path lines
    return Object.keys( this.pathLinesText[ superRegion ] ) ;
  }

  //Get all larger region names (UK, US, World, etc...)
  getAllSuperregionIdentifiers() {
    return Object.keys( this.pathLinesText ) ;
  }

  //For a given postcode, return the full path
  getPathForPostcode( postcode ) {
    //Just return the data from the object
    return this.pathLinesText[ "UK" ][ postcode ] ;
  }

  //For a given first two letters of the postcode,
  //return the correct id for the Elements
  getIdFromPostcode( postcode ) {
    //postcode_areapath
    return postcode + "_areapath"
  }

  getPointsFromPostcode( postcode ) {
    //Just return the data from the object
    return this.pathLinesText[ "UK" ][ postcode ] ;
  }

  /*
  * Returns an SVG path based on a region
  * and a subregion given as arguments
  * These correspond to the regions and subregions
  * defined in pathLinesText
  * Currently supported
  * UK, postcode letters (AB, CB, MK, etc)
  * US, state letter codes (MA, AK, KY, etc)
  */
  getRegionPath( region , subregion ) {
    return this.pathLinesText[ region ][ subregion ] ;
  }

